import Head from "next/head";
import Navbar from "./Navbar";

const Layout = props => (
  <div>
    <Head>
      <title>BitCoinPricer</title>
      <link ref="stylesheet"></link>
    </Head>
    <Navbar />
    {props.children}
  </div>
);

export default Layout;
